import React from 'react'
import Header from '../components/Header';
import AnimatedText from '../components/AnimatedText'
import './home.css'
// import image from '../img/image.png';


export default function Home() {
  return (
    <>
    <div >
        <Header/>

        <div className='home'>
        <br/><br/>
        
        <h1>This is a Home page</h1>
     
    </div>
    </div>
    </>
  )
}
